import React from "react";
import './form.css'
import Button from "../button/Button";
const Form = ()=>{
    return (
        <div>
          <form className="Form_container">
            <label>UserName</label>
            <input type="text"></input>
            <label>Password</label>
            <input type="password"></input>
            <Button type="submit" ></Button>
          </form>
        </div>
    );
}

export default Form;
